column8:
MAKINTOSH(マッキントッシュ）から人気のキルティングボアコート<br>
grangeが入荷！。ポリエステル素材100％の美しいシルエットのアウター。<br>
マットな質感の表地と、高級感溢れるボアは袖裏・フード、ポケット<br>
の裏側まで施されています。柔らかくて心地良い肌触りと、保温性<br>
バツグンの機能性を持ちながらスッキリとしたAラインの細身の<br>
シルエットはオンからオフまで着まわせる優秀アウター。羽織る<br>
だけで、洗練された上品な大人の雰囲気になるアイテムです。<br><br>

原産国：スコットランド<br><br>■素材 表地：ポリエステル100%　裏地：ポリエステル100%　中綿：ポリエステル100%<table width="100%" cellspacing="2" cellpadding="0" border="0">
